import React from "react";
import { Input, Button } from "antd";

const Formulaire = () => (
  <form>
    <div className="exercise">
      <Input addonBefore="exercise" />
      <Input addonBefore="series" />
      <Input addonBefore="repetitions" />
      <Input addonBefore="repos" addonAfter="secondes" />
    </div>
    <Button 
    type="primary" 
    htmlType="submit">
      envoyer le pdf
    </Button>
  </form>
);

export default Formulaire;
